import Menu from '../components/Menu';
import 'bootstrap/dist/css/bootstrap.min.css';
import React from 'react';
import { Container, Row, Col } from 'reactstrap';

function HomePage() {
    return (
        <Container>
            <Col>
            <div>
                <Menu />
                Home
            </div>
            </Col>

        </Container>
    )
}

export default HomePage
